Question: Two runners, $A$ and $B,$ start at a point $O$ on a linear track, and start running in the same direction.  Runner $B$ runs three times as fast as runner $A.$  An observer stands at point $P$ so that $\overline{OP}$ is perpendicular to the track.  Find the maximum of $\angle APB,$ in degrees.

[asy]
unitsize(2 cm);

pair A, B, O, P;

A = (0.4,0);
B = (1.2,0);
O = (0,0);
P = (0,1);

draw((-0.5,0)--(2,0));
draw(O--P);
draw(P--A);
draw(P--B);

label("$A$", A, S);
label("$B$", B, S);
label("$O$", O, S);
label("$P$", P, N);
[/asy]
Response: Let's denote the speed of runner A as \( v \). Then the speed of runner B is \( 3v \). Let's assume that runner A starts at point O and runner B starts at a point \( P \) on the track. Since \( \overline{OP} \) is perpendicular to the track, the distance between O and P is the same as the distance between A and B at any given time. Let's denote the distance between O and P as \( d \). The distance between A and B at time \( t \) is \( 3vt - vt = 2vt \). The distance between A and B is \( 2vt \), and the distance between O and A is \( vt \). The distance between O and B is \( 3vt \). The angle \( \angle APB \) can be found using the tangent function. The tangent of the angle \( \angle APB \) is given by the ratio of the opposite side to the adjacent side, which is \( \frac{2vt}{vt} = 2 \). Therefore, \( \angle APB = \tan^{-1}(2) \). The maximum value of \( \angle APB \) is \( \tan^{-1}(2) \). </think>
<answer>\boxed{45^\circ}</answer>
