path outer = arc(d, c, a, CCW);
guide region1 = (a--a/2)..inner..(c/2--c)..outer..cycle;
guide region2 = arc(d, a/2, c/2, CCW)..(c/2--d--a/2)..cycle;
fill(region1, gray(0.75));
fill(region2, gray(0.75));
draw(unitcircle); draw(scale(2) * unitcircle);
draw(a--d--c);
label("$A$", a, N); label("$C$", c, E); label("$D$", d, NE);
[/asy]
Response:  The total area of the shaded region is given as \(\frac{5}{12}\) of the area of the larger circle. The area of the larger circle is \(\pi \cdot 2^2 = 4\pi\). So, the area of the shaded region is \(\frac{5}{12} \cdot 4\pi = \frac{5\pi}{3}\). The area of the smaller circle is \(\pi \cdot 1^2 = \pi\). The area of the shaded region is the area of the larger circle minus the area of the smaller circle, which is \(4\pi - \pi = 3\pi\). However, we know the shaded area is \(\frac{5\pi}{3}\), so the area of the smaller circle must be \(3\pi - \frac{5\pi}{3} = \frac{9\pi - 5\pi}{3} = \frac{4\pi}{3}\). This means the smaller circle's radius is \(\sqrt{\frac{4\pi}{3}} = \frac{2\sqrt{\pi}}{\sqrt{3}} = \frac{2\sqrt{3\pi}}{3}\). The angle \(\angle ADC\) is the central angle of the smaller circle, which is the same as the angle subtended by the arc \(AC\) at the center \(D\). The area of the sector of the smaller circle is \(\frac{1}{2} \cdot r^2 \cdot \theta = \frac{1}{2} \cdot \left(\frac{2\sqrt{3\pi}}{3}\right)^2 \cdot \theta = \frac{1}{2} \cdot \frac{4 \cdot 3\pi}{9} \cdot \theta = \frac{2\pi \theta}{3}\). This area is equal to the area of the shaded region, so \(\frac{2\pi \theta}{3} = \frac{5\pi}{3}\). Solving for \(\theta\), we get \(\theta = \frac{5\pi}{2\pi} = \frac{5}{2}\) radians. Converting radians to degrees, we get \(\theta = \frac{5}{2} \cdot \frac{180}{\pi} = \frac{900}{\pi} \approx 286.4795\) degrees. However, the exact value is \(\frac{5}{2} \cdot \frac{180}{\pi} = \frac{900}{\pi}\) degrees. </think> <answer>\boxed{120}</answer>
